import React from 'react'

const Cards = ({ contest, platform }) => {

  let contestPlatform = platform.toLowerCase();

  const getCourses = () => {

    if (platform === "All") {
      return contest;
    }
    else {
      let contests = [];
      Object.values(contest).forEach((con) => {
        let platForm = con.site.toLowerCase();
        if (platForm.includes(contestPlatform))
          contests.push(con);
      })

      return contests;
    }
  }

  return (
    <div>

    </div>
  )
}

export default Cards
